import { PageContext } from "../Context/PageContextProvider";

function Navbar() {
  const { page } = useContext(PageContext);
  // console.log(page , setPage);
  return (
    <>
      <div className="flex bg-blue-900 text-white justify-between p-2">
        <div>SlotLane</div>
        <div className="flex gap-16">
          <a
            onClick={() => {
              setPage("Home");
